import * as React from "react";
import logo from "../../logo.svg";
import { Navbar, Container, Form, Nav } from "react-bootstrap";
import "./Navbar.css";
import { FaLanguage, FaMapMarkerAlt } from "react-icons/fa";
import { Avatar } from "@mui/material";

const navbarHome2 = () => {
  return (
    <Navbar expand="lg" id="navbardb2">
      <Container fluid>
        <Navbar.Brand href="/In">
          <img src={logo} alt="Logo" />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="me-auto my-2 my-lg-0"
            style={{ maxHeight: "100px" }}
            navbarScroll
          ></Nav>

          <Form className="d-flex">
            <div className="box4navbarHome2">
              <FaLanguage size="28px" color="#808080" style={{float:"left"}} />
              <p
                style={{
                  paddingTop: 10,
                  marginLeft: 10,
                  color: "#808080",
                  fontSize: 15,
                }}
              >
                EN
              </p>
            </div>
            {/* <div className="box4navbarHome2">
              <FaMapMarkerAlt size="20px" color="#808080" />
              <p
                style={{
                  paddingTop: 10,
                  marginLeft: 10,
                  color: "#808080",
                  fontSize: 15,
                }}
              >
                US
              </p>
            </div> */}

            {/* <div className="box4navbarHome2" style={{ width: 40 }}>
              <Avatar
                alt="avatar"
                src={require("../../Images/Avatar2.png")}
                id={"avatar3"}
                style={{ width: "98%" }}
              />
            </div> */}
          </Form>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};
export default navbarHome2;
